let featureMaximum1 = -Infinity;
let featureMaximum2 = -Infinity;
let featureMinimum1 = Infinity;
let featureMinimum2 = Infinity;
let outputsMax = 0;
let string1 = "";
let string2 = "";


let validation_data = [];
let trainingOhneVal = [];

let g1_slider;
let g2_slider;

function setup() {
  createCanvas(1400, 750);
  nn = new NeuralNetwork(2, [20, 10, 50], 1);
  g1_slider = createSlider(-2, 2, 0.8, 0, 0.01);
  g1_slider.style('width', '500px');
  g1_slider.position(673, 650);
  g1_slider.hide();


  g2_slider = createSlider(-2, 2, -1.4, 0, 0.01);
  g2_slider.style('width', '500px');
  g2_slider.position(420, 400);
  g2_slider.style('rotate', 270);
  g2_slider.hide();

  button();
  nn.setActivationFunction(sigmoid);
  nn.setLearningRate(0.05);

  for (let i = 0; i < training_data.length; i++) {
    if (training_data[i].inputs[0] > featureMaximum1) {
      featureMaximum1 = training_data[i].inputs[0];
    }
    if (training_data[i].inputs[1] > featureMaximum2) {
      featureMaximum2 = training_data[i].inputs[1];
    }
    if (training_data[i].inputs[0] < featureMinimum1) {
      featureMinimum1 = training_data[i].inputs[0];
    }
    if (training_data[i].inputs[1] < featureMinimum2) {
      featureMinimum2 = training_data[i].inputs[1];
    }
    if (training_data[i].outputs[0] > outputsMax) {
      outputsMax = training_data[i].outputs[0];
    }
  }

  for (let i = 0; i < training_data.length; i++) {
    training_data[i].inputs[0] = (training_data[i].inputs[0] - featureMinimum1) / (featureMaximum1 - featureMinimum1);
    training_data[i].inputs[1] = (training_data[i].inputs[1] - featureMinimum2) / (featureMaximum2 - featureMinimum2);
    training_data[i].outputs[0] = training_data[i].outputs[0] / outputsMax;
  }

  if (max && min) {
    string1 = "Maximum";
    string2 = "Minimum";
  } else if (max && slope) {
    string1 = "Maximum";
    string2 = "Steigung";
  } else if (max && mean) {
    string1 = "Maximum";
    string2 = "Mittelwert";
  } else if (min && slope) {
    string1 = "Minimum";
    string2 = "Steigung";
  } else if (min && mean) {
    string1 = "Minimum";
    string2 = "Mittelwert";
  } else if (slope && mean) {
    string1 = "Steigung";
    string2 = "Mittelwert";
  }

  for (let i = 0; i < 50; i++) {
    if (i % 10 == 0) {
      validation_data.push(training_data[i]);
    } else {
      trainingOhneVal.push(training_data[i]);
    }
  }
}



